import Data from './components/Data';
import { QueryClient, QueryClientProvider } from "react-query";
import './App.css';

//react-query 사용
const queryClient = new QueryClient();

function App() {
  return (
    <div className="App">
      <QueryClientProvider client={queryClient}>
          <Data/>
      </QueryClientProvider>
    </div>
  );
}

export default App;

